import React from 'react';
export function List(props) {
  return (
    <ul className="App-list">
      {props.items.map(item => (
        <li key={item.url}>
          <h4>{item.name}</h4>
          <p>{item.model}</p>
        </li>
      ))}
    </ul>
  )
}
